module.exports = JSON.parse('[{"name":"Альфия","text":"“Мы приехали с нулевым знанием языка - смотрели несколько видео уроков в ютубе, и то это был не “кастижано”. Первые дни ощущали себя беспомощными и абсолютно потерянными. А потом познакомились с курсом Анастасии. Очень этому рада. Методично, наглядно, от урока к уроку - и я уже не боюсь ходить в магазины, разговаривать с таксистами, заводить новые знакомства. Очень доступно подан материал, усваивается легко. Порядок тем подобран очень грамотно, после первых же уроков в твоём словарном запасе появляются фразы, которые помогут тебе в бытовых вопросах. Благодарю за эти уроки!”"},{"name":"Виталик","text":"“Настя стала для меня третьим преподавателем после двух аргентинцев до этого. Могу с уверенностью сказать, что она лучший преподаватель иностранного языка в моей жизни. Подача информации, задания, внимание к моим слабым сторонам и работа с ними - всё это буквально за пару месяцев позволило значительно перегнать не такой большой успех с другими преподавателями. Благодаря занятиям с ней я быстро смог подготовиться к своему первому собеседованию на испанском и поступить в ВУЗ в Аргентине. И самое главное, благодаря ей, я могу общаться с аргентинцами, а это лучшее, что может дать язык. Искренне рекомендую Настю как лучшего преподавателя испанского!”"},{"name":"Ольга","text":"“Анастасия прекрасный учитель. Она занимается с двумя детьми 8 и 15 лет. Задачи разные, но Анастасия смогла прекрасно понять задачи, подстроиться под детей и это дало отличный результат! И младший и старший уверенно продвигаются в своих знаниях и что немаловажно полюбили сам язык и процесс! Анастасия применяет совершенно разные материалы и методы, что опять же положительно сказывается на восприятии детьми нового материала. Всем очень советуем этого преподавателя!”"},{"name":"Екатерина","text":"“Большое спасибо, за такие интересные и продуктивные уроки! Все очень четко, структурно, все понятно и легко запоминается! Очень классно выстроена программа: во-первых, вся лексика - нужная, ничего лишнего! Все примеры фраз, упражнений - это именно то, с чем вы столкнетесь в бытовой жизни, когда приедете в испаноговорящую страну. Во-вторых, очень грамотно подобраны упражнения для отработки правил и домашнего задания. ВСЯ лексика постоянно повторяется, и ты не забываешь то, что было три урока назад. В-третьих, подача материала четко структурирована: все правила и исключения, ВСЕ понятно! Не нужно заучивать 100500 форм глаголов на разные случаи. Просто четко знаешь правило и действуешь по аналогии. Я с Настей занималась несколько месяцев до своего приезда в Аргентину, и этих знаний мне хватило, чтобы уверенно себя чувствовать. Я, конечно, не всегда понимала то, что мне говорят, но сама изъясниться всегда могла. Кстати, очень здорово, что Настя сама живет в Аргентине уже 5 лет, и знает все особенности местного диалекта. А также может помочь и с бытовыми вопросами: подсказать лучшие районы, посоветовать рестораны и блюда, проконсультировать по документам. Ещё хочу поделиться печальным опытом: по приезду в Аргентину я решила продолжить учить язык с местным учителем, и это был ужас! Никакой структуры! От слова СОВСЕМ! Мы сначала делали упражнение, а потом под упражнением увидели правило, по которому нужно делать это упражнение 🤷‍♀️🤦‍♀️. Я уже молчу о том, что на занятиях мы учили слова охотник, сапожник и вся лексика в таком духе… В общем, я просто уже дохаживала эти занятия и ждала с нетерпением, когда они закончатся…”"}]');

